description:
The videographer used to hang out at the beach and shoot video of the girls walking by or playing in the surf.  The local beach hangout held bikini contests and was a great scene on the weekend for girls in all sorts of swimwear. He actually used to handout business cards to hot girls for paid modeling shoots. There were big events too throughout the year and drew big crowds full of hot babes.  Lots of close up shots. All shot on a public beach area with hand held camera.

This is a DVD ISO of one of his productions.  If people will continue to seed this then I will upload some others but if everyone just gets it then splits, I will quit as I am tired of not very many seeders so I ask of you to please SEED.


